import React, { useState, useEffect } from 'react';

function Profile({ userName, onBack }) {
  const [profileData, setProfileData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const [isEditing, setIsEditing] = useState(false);
  const [editForm, setEditForm] = useState({ userName: '', email: '' });

  useEffect(() => {
    async function fetchProfile() {
      setLoading(true);
      setError(null);
      try {
        const response = await fetch(`http://localhost:5000/api/users/user/by-name/${userName}`);
        if (!response.ok) throw new Error('Nu s-au putut încărca datele profilului.');
        const data = await response.json();
        setProfileData(data);
        setEditForm({ userName: data.userName, email: data.email || '' }); // email dacă e returnat
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    }
    fetchProfile();
  }, [userName]);

  // Funcție pentru update profil
  const handleSave = async () => {
    try {
      const res = await fetch(`https://localhost:7157/api/users/${profileData.userId}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          ...profileData,
          userName: editForm.userName,
          email: editForm.email
        })
      });
      if (!res.ok) throw new Error('Eroare la salvare.');
      setProfileData(prev => ({ ...prev, userName: editForm.userName, email: editForm.email }));
      setIsEditing(false);
    } catch (err) {
      alert(err.message);
    }
  };

  if (loading) return <p>Loading profile...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div className="profile-container">
      <h2 className="profile-header">Profilul Utilizatorului</h2>

      {!isEditing ? (
        <>
          <div className="profile-info">
            <div><strong>ID:</strong> {profileData.userId}</div>
            <div><strong>Utilizator:</strong> {profileData.userName}</div>
            <div><strong>Email:</strong> {profileData.email}</div>
            <div><strong>Cont:</strong> {profileData.accountId}</div>
            <div><strong>Tip Cont:</strong> {profileData.accountType}</div>
            <div><strong>Monedă:</strong> {profileData.currency}</div>
          </div>
          <button onClick={() => setIsEditing(true)}>Editare profil</button>
          <button onClick={onBack}>Înapoi la Dashboard</button>
        </>
      ) : (
        <>
          <div className="profile-info">
            <label>
              Utilizator:
              <input
                type="text"
                value={editForm.userName}
                onChange={e => setEditForm({ ...editForm, userName: e.target.value })}
              />
            </label>
            <br />
            <label>
              Email:
              <input
                type="email"
                value={editForm.email}
                onChange={e => setEditForm({ ...editForm, email: e.target.value })}
              />
            </label>
          </div>
          <button onClick={handleSave}>Salvează</button>
          <button onClick={() => setIsEditing(false)}>Renunță</button>
        </>
      )}
    </div>
  );
}

export default Profile;
